.code
MAIN PROC FAR
	;your code
	               MOV   AX, @DATA
	               MOV   DS,AX

	               mov   ah,0
	               mov   al,13h
	               int   10h           	;set graphics mode(320x200)

	               CALL  InputPlayer1
	               CALL  CLEAR_SCREEN
	               CALL  InputPlayer2
	               call  CLEAR_SCREEN

	MAINMENUELOOP: 
	               CALL  CLEAR_SCREEN
	               CALL  MENUES1
	;check if any key is being pressed (if not check again)
	CHECK_AGAIN:   
	               MOV   AH,01H
	               INT   16H
	               JZ    CHECK_AGAIN   	;if no press => ZF =0 => check again
	;check which key is being pressed
	               MOV   AH,00H        	;AL=ASCII Code AH=Scan code
	               INT   16H
	;if it is 'f1'
	               CMP   AH,3BH
	               JNE   BAR1
	               CALL  START_CHATING
	               call  Initialize_chat
	               jmp   MAINMENUELOOP
	BAR1:          

   
	;if it is 'f2'
	               CMP   AH,3CH
	               jne   BAR8
	               call  CLEAR_SCREEN
	               CALL  choose_level
	CHECK_AGAIN3:  

	               MOV   AH,01H
	               INT   16H
	               CMP   AH,3BH
	               JNE   BAR9
	               CALL  START_GAME
	 
	BAR9:          

	               CMP   AH,3ch
	               JNE   BAR10
	               CALL  Level2
	               
	BAR10:         
	               jmp   CHECK_AGAIN3

	               
           

	BAR8:          
	;if it is 'Esc'
	               CMP   AL,1bH
	               JNE   BAR2          	; 1BH is the Ecs ASCII code
	               CALL  END_GAME
	BAR2:          
	               JMP   CHECK_AGAIN   	;neither f1 nor f2 nor Esc

MAIN ENDP

CROSSJMP proc near
	               jmp   Level2Loop
	               ret
CROSSJMP ENDP

Level2 proc near
	               call  CLEAR_SCREEN
	               CALL  Draw          	;here we draw the background

	Level2Loop:    
	               mov   ah,2Ch
	               int   21h           	;get the time dl->seconds
	               cmp   dl,TIME_FRAME 	; if the same check again
	               je    Level2Loop
	               mov   TIME_FRAME,dl 	;update the time
	               cmp   Respawn_Time,0	;if Respawn_Time is zero we generate a random Power-ups
	               jne   KeepGaming
	               mov   ax,0          	;this section to randomize which power-up to respawn
	               mov   al,dl
	               mov   bl,2
	               div   bl
	               cmp   ah,0          	;if 0=> Respawn Fire, if 1=> Respawn Freeze
	               je    Fire
	               mov   cl,2
	               mov   RESPAWNFREEZESTATUS,cl
	               call  Respawn_PowerUp_FREEZE
	               jmp   KeepGaming
	Fire:          
	               mov   cl,2
	               mov   RESPAWNFIRESTATUS,cl
	               call  Respawn_PowerUp_FIRE
	               jmp   KeepGaming


	KeepGaming:    
	               CALL  CLEAR_BALL    	;1-clear the entire objects(the ball && the R&L paddles)
	               CALL  CLEAR_PADDLE_LEFT
	               CALL  CLEAR_PADDLE_RIGHT
	               CALL  CLEAR_FreezePowerRight
	               CALL  CLEAR_FreezePowerLeft
	               CALL  CLEAR_FirePowerLeft
	               CALL  CLEAR_FirePowerRight
	               CALL  MOVE_BALL_PROC	;2-move ball
	               CALL  DRAW_BALL_PROC	;3-draw ball
       

	               CALL  MOVE_PADDLE_PROC                   	;4-move paddle
	               CALL  DRAW_PADDLE_LEFT_PROC              	;5-draw paddle left
	               CALL  DRAW_PADDLE_RIGHT_PROC             	;6-draw paddle right
	               CALL  DRAW_CENTER   	;7-draw center line
	               CALL  DRAW_SCORE    	;8-drawing the score
										MOV   BL,LEFT_SCORE_GAMES
	               CMP   BL,0
	               JNE   BAR13
		
	               MOV   BL,LEFT_SCORE_DER_GAME
	               CMP   BL,5
	               JNE   BAR13
	               JMP   MENUES2       	;move to game over screen
	BAR13:          

	               MOV   BL,RIGHT_SCORE_GAMES
	               CMP   BL,0
	               JNE   BAR14
								
	               MOV   BL,RIGHT_SCORE_DER_GAME
	               CMP   BL,5
	               JNE   BAR14
	               JMP   MENUES2       	;move to game over screen
	BAR14:  
	               CALL  COUNTFREEZEP1 	;if the palyer 1 is frozen we here spend the freeze time of that player
	               CALL  COUNTFREEZEP2 	;if the palyer 2 is frozen we here spend the freeze time of that player
	               dec   Respawn_Time  	;9-Spend the cooldown respawning time


	;powers procs
	               cmp   RESPAWNFREEZESTATUS,0              	;if RESPAWNFREEZESTATUS == 0 we don't respawn Freeze
	               je    CHECKFIRESTATUS
	               CALL  MOVE_FREEZE_POWER_RIGHT_PROC
	               CALL  DRAW_FREEZE_POWER_RIGHT_PROC
	               CALL  MOVE_FREEZE_POWER_LEFT_PROC
	               CALL  DRAW_FREEZE_POWER_LEFT_PROC
	               jmp   Level2Loop


	CHECKFIRESTATUS:                    
	               cmp   RESPAWNFIRESTATUS,0                	;if RESPAWNFIRESTATUS == 0 we don't respawn Fire
	               je    DONTRESPAWNFIRE
	               CALL  MOVE_FIRE_POWER_RIGHT_PROC
	               CALL  DRAW_FIRE_POWER_RIGHT_PROC
	               CALL  MOVE_FIRE_POWER_LEFT_PROC
	               CALL  DRAW_FIRE_POWER_LEFT_PROC

	               jmp   Level2Loop

	DONTRESPAWNFIRE:                    
	               CALL  CROSSJMP


	  

	               ret
Level2 EndP


InputPlayer1 proc near
	Enter_Name1:   
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,8          	;Y-position of the message
	               INT   10H
           
	               MOV   AH,09H
	               MOV   DX,offset Mes5	;print the first line
	               INT   21H
	InputName1:    

	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,15         	;move the cursor to the new line
	               INT   10H

	               MOV   AH,09H
	               MOV   DX,offset Mes6	;print the second line
	               INT   21H
								  
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,11         	;move the cursor to the new line
	               INT   10H
           
	               mov   ah,0aH
	               mov   dx,offset player1name              	;read player1 name
	               int   21h

	;first char is a capital char means between A(41h) and Z(5Ah)
	               cmp   player1name+2,41h
	               jl    Invalid1
	               cmp   player1name+2,5ah
	               jg    Invalid1

	;Here I loop on the rest of the name checking that they are small chars betwwen a(61h) and z(7ah)
	               mov   cl,player1name+1
	               sub   cl,1
	               mov   ch,0
	               mov   si, offset player1name+3
	Validation1:   
	               mov   al, byte ptr [si]
	               cmp   byte ptr [si],61h
	               jl    Invalid1
	               cmp   byte ptr [si],7ah
	               jg    Invalid1
	               inc   si
	               loop  Validation1
	               ret


	Invalid1:      
	               call  CLEAR_SCREEN
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,8          	;Y-position of the message
	               INT   10H
           
	               MOV   AH,09H
	               MOV   DX,offset Mes7	;print the first line
	               INT   21H
	               jmp   InputName1
	               ret
InputPlayer1 ENDP

InputPlayer2 PROC near

	Enter_Name2:   
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,8          	;Y-position of the message
	               INT   10H

	               MOV   AH,09H
	               MOV   DX,offset Mes5	;print the first line
	               INT   21H
	InputName2:    

	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,15         	;move the cursor to the new line
	               INT   10H

	               MOV   AH,09H
	               MOV   DX,offset Mes6	;print the second line
	               INT   21H
								  
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,11         	;move the cursor to the new line
	               INT   10H
           
	               mov   ah,0aH
	               mov   dx,offset player2name              	;read player 2 name
	               int   21h

	;first char is a capital char means between A(41h) and Z(5Ah)
	               cmp   player2name+2,41h
	               jl    Invalid2
	               cmp   player2name+2,5ah
	               jg    Invalid2

	;Here I loop on the rest of the name checking that they are small chars betwwen a(61h) and z(7ah)
	               mov   cl,player2name+1
	               sub   cl,1
	               mov   ch,0
	               mov   si, offset player2name+3
	Validation2:   
	               mov   al, byte ptr [si]
	               cmp   byte ptr [si],61h
	               jl    Invalid2
	               cmp   byte ptr [si],7ah
	               jg    Invalid2
	               inc   si
	               loop  Validation2

	               ret

	Invalid2:      
	               call  CLEAR_SCREEN
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,8          	;Y-position of the message
	               INT   10H
           
	               MOV   AH,09H
	               MOV   DX,offset Mes7	;print the first line
	               INT   21H
	               jmp   InputName2
	               ret
InputPlayer2 ENDP

Draw Proc near
	               mov   ax, 4F02h     	; This Graphics mode configuration uses SVGA configuration (https://en.wikipedia.org/wiki/Super_VGA)
	; which was not even created when asm86 first came out. I use it to be able to use 256 colors on 640x400
	; it should work fine on tasm/masm extension for VSCode if your project does not use mouse clicks as controls
	               mov   bx, 0100h
	; INT  10h     	;execute the configuration
	               MOV   AH,0Bh        	;set the configuration
	               MOV   CX, imgW      	;set the width (X) up to image width (based on image resolution)
	               MOV   DX, imgH      	;set the hieght (Y) up to image height (based on image resolution)
	               mov   DI, offset img	; to iterate over the pixels
	               jmp   Start         	;Avoid drawing before the calculations
	Drawit:        
	               MOV   AH,0Ch        	;set the configuration to writing a pixel
	               mov   al, [DI]      	; color of the current coordinates
	               MOV   BH,00h        	;set the page number
	               INT   10h           	;execute the configuration
	Start:         
	               inc   DI
	               DEC   Cx            	;  loop iteration in x direction
	               JNZ   Drawit        	;  check if we can draw c urrent x and y and excape the y iteration
	               mov   Cx, imgW      	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	               DEC   DX            	;  loop iteration in y direction
	               JZ    ENDING        	;  both x and y reached 00 so end program
	               Jmp   Drawit

	ENDING:        
	               RET
Draw EndP
START_GAME proc NEAR
	               CALL  CLEAR_SCREEN
	               CALL  Draw          	;here we draw the background

	MIAN_LOOP:     
	               mov   ah,2Ch
	               int   21h           	;get the time dl->seconds
	               cmp   dl,TIME_FRAME 	; if the same check again
	               je    MIAN_LOOP
	               mov   TIME_FRAME,dl 	;update the time
	               CALL  CLEAR_BALL    	;1-clear the entire objects(the ball && the R&L paddles)
	               CALL  CLEAR_PADDLE_LEFT
	               CALL  CLEAR_PADDLE_RIGHT
	               CALL  MOVE_BALL_PROC	;2-move ball
	               CALL  DRAW_BALL_PROC	;3-draw ball
       

	               CALL  MOVE_PADDLE_PROC                   	;4-move paddle
	               CALL  DRAW_PADDLE_LEFT_PROC              	;5-draw paddle left
	               CALL  DRAW_PADDLE_RIGHT_PROC             	;6-draw paddle right
	               CALL  DRAW_CENTER   	;7-draw center line

	               CALL  DRAW_SCORE    	;drawing the score
								  
	               MOV   BL,LEFT_SCORE_GAMES
	               CMP   BL,0
	               JNE   BAR3
		
	               MOV   BL,LEFT_SCORE_DER_GAME
	               CMP   BL,5
	               JNE   BAR3
	               JMP   MENUES2       	;move to game over screen
	BAR3:          

	               MOV   BL,RIGHT_SCORE_GAMES
	               CMP   BL,0
	               JNE   BAR4
								
	               MOV   BL,RIGHT_SCORE_DER_GAME
	               CMP   BL,5
	               JNE   BAR4
	               JMP   MENUES2       	;move to game over screen
	BAR4:          


	               CALL  DELAY
	         
	               jmp   MIAN_LOOP
	               RET

START_GAME ENDP

DELAY proc near
	               mov   cx,00h
	               mov   dx, 0ffffh
	               mov   ah,86h
	               int   15h
	               ret
DELAY ENDP

START_CHATING proc NEAR

	               CALL  CLEAR_SCREEN
	               CALL  DRAWCHATAREA

	Chat_Loop:     
	;set the Cursor for sender
	               MOV   AH, 02H
	               MOV   BH, 0
	               MOV   DL, User1X
	               MOV   DH, User1Y
	               INT   10H

							

	Chat_Send:     
	;check if a char is pressed to be sent
	               CAll  GetKeyPressed
	               JZ    Chat_Receive  	;Skip processing user input if no key is pressed
	               MOV   ChatSentChar, AL
	               CALL  SendChar
	               CALL  ProcessInputsend

	;Get secondary user input
	Chat_Receive:  
	;check if a key is pressed to be recieved
	               CALL  ReceiveChar
	               JZ    Chat_Check    	;Skip processing user input if no key is received
	               MOV   ChatReceivedChar, AL
	               CALL  ProcessInputreciee
	Chat_Check:    
	;check if a user exit out the chat
	               CMP   IsChatEnded, 0
	               JZ    Chat_Loop
	               RET
START_CHATING ENDP

END_GAME proc NEAR
	               CALL  CLEAR_SCREEN
	               MOV   AH, 4CH
	               MOV   AL, 01
	               INT   21H
END_GAME ENDP

MENUES1 PROC NEAR
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,8          	;Y-position of the message
	               INT   10H
           
	               MOV   AH,02H
	               MOV   DL,'*'        	;print the first *
	               INT   21H
           
	               MOV   AH,09H
	               MOV   DX,offset MES1	;print the first line
	               INT   21H
           
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,11         	;move the cursor to the new line
	               INT   10H
           
	               MOV   AH,02H
	               MOV   DL,'*'        	;print the second *
	               INT   21H
           
	               MOV   AH,09H        	;print the second line
	               MOV   DX,offset MES2
	               INT   21H
           
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,14         	;move the cursor to the new line
	               INT   10H
           
	               MOV   AH,02H
	               MOV   DL,'*'        	;print the third *
	               INT   21H
           
	               MOV   AH,09H        	;print the third line
	               MOV   DX,offset MES3
	               INT   21H
	               RET
MENUES1 ENDP

