CLEAR_PADDLE_RIGHT PROC near
	;first we start the image offset from the pixel that's on the top left corner of the right paddle
	;our game resulation is 320×200 so I add 320 to the offset up to the y-coordinate of the right paddle times
	;then I add the x-coordinate to the offset to get the targeted pixel
	;   -							  |
	;	|							  y-coordinate
	;	|   						  |
	;   |________x-coordinate_________.<=tageted pixel

	               mov   cx,PADDLE_RIGHT_Y
	               mov   di, offset img
	looprowpaddleright:                 
	               add   di,320
	               loop  looprowpaddleright
	               add   di,PADDLE_RIGHT_X

	;then we draw the right paddle but not with its color but with the background colors of its area
	               mov   cx,PADDLE_RIGHT_X
	               mov   dx,PADDLE_RIGHT_Y
	clear_paddle_right_lbl:             
	               mov   ah,0ch
	               mov   al,[di]
	               mov   bh,0
	               int   10h
	               inc   cx
	               inc   di
	               mov   ax,cx
	               sub   ax,PADDLE_RIGHT_X
	               cmp   ax,PADDLE_RIGHT_WIDTH
	               jne   clear_paddle_right_lbl
	               mov   cx,PADDLE_RIGHT_X
	               inc   dx
	               mov   ax,dx
	               sub   ax,PADDLE_RIGHT_Y
	               cmp   ax,PADDLE_RIGHT_HEIGHT
	               jne   clear_paddle_right_lbl
	               ret
