InitSerialPort proc near
	
	               MOV   DX, 03FBH                  	;Line control register
	               MOV   AL, 10000000b                          ;Set divisor latch access bit
	               OUT   DX, AL

	;Set LSB of the Baud rate divisor latch register
	               MOV   DX, 03F8H
	               MOV   AL, 0CH
	               OUT   DX, AL

	;Set MSB of the Baud rate divisor latch register
	               MOV   DX, 03F9H
	               MOV   AL, 0
	               OUT   DX, AL

	;Set serial port configurations
	               MOV   DX, 03FBH                   	
	               MOV   AL, 00011011B
	               OUT   DX, AL
	               ret
InitSerialPort EndP


DRAWCHATAREA PROC NEAR

	               mov   ah,0
	               mov   al,13h
	               int   10h

	               mov   ah,6          	; function 6
	               mov   al,1          	; scroll by 1 line
	               mov   bh,7          	; normal video attribute
	               mov   ch,0          	; upper left Y
	               mov   cl,0          	; upper left X
	               mov   dh,8          	; lower right Y
	               mov   dl,79         	; lower right X
	               int   10h

	               CALL  InitSerialPort

	               MOV   AH, 02H
	               MOV   BH, 0
	               MOV   DL, 0
	               MOV   DH, 0
	               INT   10H

							
	               MOV   AH,09H
	               MOV   DX,offset player1name+2
	               INT   21H

	             
							
	               MOV   AH, 02H
	               MOV   BH, 0
	               MOV   DL, 0
	               MOV   DH, 10
	               INT   10H

							
	               MOV   AH,09H
	               MOV   DX,offset player2name+2
	               INT   21H

	               


	               MOV   AH, 02H
	               MOV   BH, 0
	               MOV   DL, 0
	               MOV   DH, 23
	               INT   10H

							
	               MOV   AH,09H
	               MOV   DX,offset Line
	               INT   21H

	               MOV   AH, 02H
	               MOV   BH, 0
	               MOV   DL, 0
	               MOV   DH, 24
	               INT   10H

	               MOV   AH,09H
	               MOV   DX,offset EndChatMsg
	               INT   21H
	               ret
DRAWCHATAREA ENDP

	;Send character through serial port
SendChar proc near
	Send:          
	               MOV   DX, 03FDH                 	
	               IN    AL, DX
	               AND   AL, 00100000B 	
	               JZ    Send          	
	               MOV   DX, 03F8H
	               MOV   AL, ChatSentChar
	               OUT   DX, AL
	               ret
SendChar EndP

	;Receive a character from the serial port into AL
ReceiveChar proc near
	               MOV   AL, 0
	               MOV   DX, 03FDH                  	
	               IN    AL, DX
	               AND   AL, 00000001B 	
	               JZ    Return        	
	               MOV   DX, 03F8H
	               IN    AL, DX
	Return:        
	               ret
ReceiveChar EndP

GetKeyPressed proc near
	               MOV   AH, 01H
