GetKeyPressed ENDP

ProcessInputsend proc near


	;Check If We rich The left Border
	               mov   al,User1X
	               cmp   al,40
	               jl    CheckEscapeSEnder
	               cmp   User1Y , 7
	               JNE   label1
	               Jmp   ScrollSender
	label1:        
	               inc   User1Y
	               mov   User1X,1

	;Check if ESC is pressed
	CheckEscapeSEnder:                  
	               CMP   ChatSentChar, 1BH
	               JNE   CheckEnterSender
	               MOV   IsChatEnded, 1
	               RET

    
	;Check if Enter is pressed
	CheckEnterSender:                   
	               CMP   ChatSentChar, 0DH
	               JNE   CheckBackspaceSender
	               MOV   User1X, ChatMargin
	               INC   User1Y
	               JMP   ScrollSender
	    
	;Check if Backspace is pressed
	CheckBackspaceSender:               
	               CMP   ChatSentChar, 08H
	               JNE   CheckPrintableSender
	               CMP   User1X, ChatMargin
	               JBE   CheckPrintableSender
	               MOV   ChatSentChar, ' '
	               DEC   User1X
	                    
	               MOV   AH, 02H
	               MOV   BH, 0
	               MOV   DL, User1X
	               MOV   DH, User1Y
	               INT   10H

	               MOV   AH, 02H
	               MOV   DL, ChatSentChar
	               INT   21H
	               RET

    
	;Check if printable character is pressed
	CheckPrintableSender:               
	               CMP   ChatSentChar, ' '                  	;Compare with lowest printable ascii value
	               JB    ReturnSender
	               CMP   ChatSentChar, '~'                  	;Compare with highest printable ascii value
	               JA    ReturnSender
    
	;Print char
	               MOV   AH, 02H
	               MOV   BH, 0
	               MOV   DL, User1X
	               MOV   DH, User1Y
	               INT   10H


	               MOV   AH, 02H
	               MOV   DL, ChatSentChar
	               INT   21H

    
	; new cursor position after printing the character
	AdjustCursorPosSender:              
	               INC   User1X
	               CMP   User1X, ChatAreaWidth-ChatMargin
	               JL    ReturnSender
	               MOV   User1X, ChatMargin
	               INC   User1Y

    
	;chat area one step up if chat area is full with letters
	ScrollSender:  
	               mov   ax, ChatAreaHeight
	               Sub   ax,1 
	               CMP   User1Y, al                        
	               JBE   ReturnSender
	               DEC   User1Y

	               MOV   AH, 06H
	               MOV   AL, 1
	               MOV   BH, 0
	               MOV   CL, 0
	               MOV   CH, 1
	               MOV   DL, ChatAreaWidth
	               MOV   DH, ChatAreaHeight
	;SUB   DH, 1
	               INT   10H




    
	ReturnSender:  
	               ret
ProcessInputsend ENDP


