	               ret
ProcessInputreciee ENDP

Initialize_chat proc near                                     ; initialize chat variables

	               mov   al,0
	               mov   IsChatEnded,al

	               mov   al,1                                 ; initialize all variables of cursores
	               mov   User1X,al

	               mov   User1Y,al
	               mov   User2X,al

	               mov   al,11
	               mov   User2Y,al

	
	               ret
Initialize_chat ENDP


choose_level proc near

	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,8          	;Y-position of the message
	               INT   10H
           
	               MOV   AH,02H
	               MOV   DL,'*'        	;print the first *
	               INT   21H
           
	               MOV   AH,09H
	               MOV   DX,offset MES8	;print the first line
	               INT   21H
           
	               MOV   AH,02H        	;move cursor to X,Y position
	               MOV   DL,6          	;X-position of the message
	               MOV   DH,11         	;move the cursor to the new line
	               INT   10H
           
	               MOV   AH,02H
	               MOV   DL,'*'        	;print the second *
	               INT   21H
           
	               MOV   AH,09H        	;print the second line
	               MOV   DX,offset MES9
	               INT   21H

	               ret
choose_level ENDP

    END MAIN
